import React, { useState, useEffect } from 'react'

function App() {

  const [data, setData] = useState([{}]);

  useEffect(() => {
    fetch("/members").then(res =>
      res.json()
    ).then(
      data => {
        setData(data);
        console.log(data);
        const array = data.members.map((item,i)=>
        {
          <li key={i}>{item}</li>
        });
      }
    ).catch(
      error => console.log(error)
    )
  }, [])



  return (
    <div >
      <span>My new app</span>
      <ul>{array}</ul>
    </div>
  );
}

export default App;
